import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";
function Plan() {
  const [plan, setPlan] = useState({});

  useEffect(() => {
    async function getAllPlan() {
      try {
        const plan = await axios.get("http://127.0.0.1:8000/list/");
        console.log(plan.data);
      } catch (error) {}
    }
  });

  return (
    <div>
      <h1>This Plane page for Demo React Django connection</h1>
    </div>
  );
}

export default Plan;
